import React from "react";

const museums = [
  {
    name: "Government Museum",
    location: "Chennai, Tamil Nadu",
    image: "/images/chennai_museum.jpg",
  },
  {
    name: "Gandhi Memorial Museum",
    location: "Madurai, Tamil Nadu",
    image: "/images/madurai_gandhi_museum.jpg",
  },
  {
    name: "Government Museum",
    location: "Thanjavur, Tamil Nadu",
    image: "/images/thanjavur_museum.jpg",
  },
  {
    name: "Fort Museum",
    location: "Chennai, Tamil Nadu",
    image: "/images/fort_museum_chennai.jpg",
  },
  {
    name: "Vivekananda House Museum",
    location: "Chennai, Tamil Nadu",
    image: "/images/vivekananda_house.jpg",
  },
];

const Museums = () => {
  return (
    <div className="p-8">
      <h1 className="text-3xl font-bold text-center text-green-700 mb-10">
        Explore Popular Museums in Tamil Nadu
      </h1>
      <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
        {museums.map((museum, index) => (
          <div
            key={index}
            className="bg-white rounded-2xl shadow-lg p-4 text-center hover:scale-105 transition-transform duration-300"
          >
            <img
              src={museum.image}
              alt={museum.name}
              className="w-full h-48 object-cover rounded-xl mb-4"
            />
            <h2 className="text-xl font-semibold mb-2">{museum.name}</h2>
            <p className="text-gray-600 mb-4">{museum.location}</p>
            <button className="bg-green-600 hover:bg-green-700 text-white py-2 px-4 rounded-full">
              Book Ticket
            </button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Museums;
